import './app.css';

import Login from './Login';
import Dashboard from './Dashboard';

const code = new URLSearchParams(window.location.search).get("code");

function App() {

  let props = {
    code: code,
    accessToken: "",
    useCode: true
  };

  return code ?
    <>
      <Dashboard code={props} />
    </>
    :
    <Login />
}

export default App;
